import React from 'react';

const Category = () => {
  return (
    <section className='category my-3 container'>
      <div className="col text-left title-list d-flex justify-content-between">
        <h1 className="title-category">Danh mục thể loại</h1>
        
      </div>
    </section>

  );
};

export default Category;
